import React, { useEffect } from 'react';
import { useNavigate, useLocation, Navigate, Link } from 'react-router-dom';
import axios from 'axios';
import Spinner from 'react-bootstrap/Spinner';

import Modal from 'react-bootstrap/Modal';

function BecomeOurPartnerModal(props) {
    let publicPath = process.env.PUBLIC_URL;


    const navigate = useNavigate();
    const location = useLocation();

    const [securityCode, setSecurityCode] = React.useState(null);

    const [loading, setLoading] = React.useState(false);
    const [formData, setFormData] = React.useState({ first_name:'', last_name: '', email: '', city: '', country: '', mobile_country_code: '', mobile_number: '', security_code: '' });
    const [formErrors, setFormErrors] = React.useState('');
    const [formValidationErrors, setFormValidationErrors] = React.useState({});


    useEffect(() => {

        genRandomString();
        setLoading(false);

    }, []);

    const genRandomString = () => {
        console.log("genRandomString");
        var text = "";
        var length = 6;
        var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
        for (var i = 0; i < length; i++) {
            text += possible.charAt(Math.floor(Math.random() * possible.length));
        }

        setSecurityCode(text);
        return text;
    }

    const onSubmit = (e) => {
        e.preventDefault()

        console.log("formData ",formData);
        if(formData.security_code !== securityCode){
            alert("Please enter correct security code");
            return false;
        }
        setLoading(true);

        axios.post('http://staging.cuengine.com/api/v7/auth', formData)
            .then((res) => {
                console.log('login res', res.status, res.data)
                if (res.status === 200) {
                    setLoading(false);

                }
            }).catch((error) => {
                setLoading(false);
                console.log("errors ### ", error.response);
                if (error.response.status === 422) {
                    console.log("errors data ", error.response.data.errors);
                    //let errorm = error.response.data.errors[0];
                    console.log("error \n", error.response.data.message)
                    setFormValidationErrors(error.response.data.errors);
                    setFormErrors(error.response.data.message);
                    setTimeout(() => {
                        setFormValidationErrors({});
                        setFormErrors('');
                    }, 5000);
                }
            })
    }


    return (
        <>
            <Modal {...props} className="enrollmentModal" backdrop="static" keyboard={false} size="lg" aria-labelledby="contained-modal-title-vcenter">
                <Modal.Header closeButton>
                    <Modal.Title id="contained-modal-title-vcenter">

                    </Modal.Title>
                </Modal.Header>
                <Modal.Body className="p-3 enrollmentModal">


                    <div className="row align-items-center">
                        <div className="col-md-4">
                            <div className="enrollmentModalleftImg">
                                <img src={publicPath + "/assets/images/support.png"} className="img-fluid" alt="" />
                            </div>
                        </div>
                        <div className="col-md-8">
                            <div className="enrollmentContent">
                                <h4>Request Enrollment</h4>
                                <form onSubmit={onSubmit}>

                                    <div className="row">
                                        <div className="col">
                                            <input className="form-control" type="text" placeholder="First Name" name="first_name" onChange={(e) => setFormData({ ...formData, first_name: e.target.value })}  />
                                        </div>
                                        <div className="col">
                                            <input className="form-control" type="text" placeholder="Last Name" name="last_name" onChange={(e) => setFormData({ ...formData, last_name: e.target.value })}  />
                                        </div>
                                    </div>
                                    <div className="row">
                                        <div className="col">
                                            <input className="form-control" type="text" placeholder="Email" name="email" onChange={(e) => setFormData({ ...formData, email: e.target.value })}  />
                                        </div>
                                    </div>
                                    <div className="row">
                                        <div className="col">
                                            <input className="form-control" type="text" placeholder="City" 
                                            name="city" onChange={(e) => setFormData({ ...formData, city: e.target.value })}  />
                                        </div>
                                        <div className="col">
                                            <input className="form-control" type="text" placeholder="Country" name="country" onChange={(e) => setFormData({ ...formData, country: e.target.value })}  />
                                        </div>
                                    </div>
                                    <div className="row">
                                        <div className="col-md-2">
                                            <input className="form-control" type="text" placeholder="+91" name="mobile_country_code" onChange={(e) => setFormData({ ...formData, mobile_country_code: e.target.value })}  />
                                        </div>
                                        <div className="col">
                                            <input className="form-control" type="text" placeholder="Mobile No." 
                                            name="mobile_number" onChange={(e) => setFormData({ ...formData, mobile_number: e.target.value })}  />
                                        </div>
                                    </div>
                                    <div className="row">
                                        <div className="captchInput">
                                            <input type="text" placeholder="Security Code" name="security_code" autoComplete="off" onChange={(e) => setFormData({ ...formData, security_code: e.target.value })}  />
                                            <span className="captha_code mr-sm-2" id="notcp">{securityCode}</span>
                                            <button type="button" onClick={() => genRandomString()} className="btn btn-default">
                                                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-arrow-repeat" viewBox="0 0 16 16">
                                                    <path d="M11.534 7h3.932a.25.25 0 0 1 .192.41l-1.966 2.36a.25.25 0 0 1-.384 0l-1.966-2.36a.25.25 0 0 1 .192-.41zm-11 2h3.932a.25.25 0 0 0 .192-.41L2.692 6.23a.25.25 0 0 0-.384 0L.342 8.59A.25.25 0 0 0 .534 9z" />
                                                    <path fillRule="evenodd" d="M8 3c-1.552 0-2.94.707-3.857 1.818a.5.5 0 1 1-.771-.636A6.002 6.002 0 0 1 13.917 7H12.9A5.002 5.002 0 0 0 8 3zM3.1 9a5.002 5.002 0 0 0 8.757 2.182.5.5 0 1 1 .771.636A6.002 6.002 0 0 1 2.083 9H3.1z" />
                                                </svg>
                                            </button>
                                        </div>
                                    </div>
                                    <div className="row">
                                        <div className="col">

                                        {loading ?
                                        <button className="btntheme" type="button" disabled >
                                        <Spinner as="span" animation="border" size="sm" role="status" aria-hidden="true" />  Submitting...
                                        </button>
                                        :
                                        <button className="btntheme" type="submit">Submit</button>
                                        }

                                        </div>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>

                </Modal.Body>
            </Modal>
        </>
    );
}

export default BecomeOurPartnerModal;
